	replace_emoticons: function(text) {
		
		var e_happy = 'data:image/png;base64,';
  		var e_laugh = 'data:image/png;base64,';
  		var e_sad = 'data:image/png;base64,';
  		var e_crying = 'data:image/png;base64,';
  		var e_tongue = 'data:image/png;base64,';
  		var e_heart = 'data:image/png;base64,';
  		var e_xenixlet = 'data:image/png;base64,';
  		var e_kitty = 'data:image/png;base64,';
  		
  		var emoticons = {
    			':-)'  : e_happy,
    			':)'   : e_happy,
    			':D'   : e_laugh,
    			':('   : e_sad,
    			':\'(' : e_crying,
    			':P'   : e_tongue,
       			':p'   : e_tongue,
    			'^_^'  : e_laugh,
  			}, patterns = [], metachars = /[[\]{}<3()*+?.\\|^$\-,&#\s]/g;

			text = XKit.tools.replace_all(text,"\&lt;3",'<img style="width: 16px;height:16px;vertical-align: -3px;" src="'+e_heart+'"/>');
			text = XKit.tools.replace_all(text,"\\(xenixlet\\)",'<img style="width: 16px;height:16px;vertical-align: -3px;" src="'+e_xenixlet+'"/>');
			text = XKit.tools.replace_all(text,"\\(cat\\)",'<img style="width: 16px;height:16px;vertical-align: -3px;" src="'+e_kitty+'"/>');
									
  			// build a regex pattern for each defined property
  			for (var i in emoticons) {
    				if (emoticons.hasOwnProperty(i)){ // escape metacharacters
      					patterns.push('('+i.replace(metachars, "\\$&")+')');
    				}
  			}

  			// build the regular expression and replace
  			return text.replace(new RegExp(patterns.join('|'),'g'), function (match) {
    				return typeof emoticons[match] != 'undefined' ?
           			'<img style="width: 16px;height:16px;vertical-align: -3px;" src="'+emoticons[match]+'"/>' :
           			match;
  			});

	},

	create_xim_window: function(from, dontsavewindowhistory) {

		if($("#xim_message_window_" + from).length > 0) {
			if (XKit.extensions.XIM.buddy_list_status[XKit.extensions.XIM.buddy_list.indexOf(from)] === "1") {
				$("#xim_message_window_" + from).find(".xim-status").addClass("online");
			}
			return;
		}

		var m_count = $(".xim-message-window").length;
		var m_right = (m_count * 235) + 30;

		var x_html = 	"<div style=\"right: " + m_right + "px;\" data-user-id=\"" + from + "\" id=\"xim_message_window_" + from + "\" class=\"xim-message-window\">" +
					"<div class=\"xim_message_title\"><div class=\"xim-status\">&nbsp;</div>" +
					"<img src=\"http://api.tumblr.com/v2/blog/" + from + ".tumblr.com/avatar/16\" class=\"xim-avatar\">" +
					"<div class=\"xim-from-title\">" + from + "</div><div data-user-id=\"" + from + "\" class=\"xim-close\">&nbsp;</div></div>" +
					"<div class=\"nano xim-messages\"><div class=\"content xim-messages-inner\"></div></div>";
		if (XKit.extensions.XIM.enable_photo_sending === true) {
			x_html = x_html + 	"<div class=\"xim-input-container\"><input data-user-id=\"" + from + "\" placeholder=\"just type\" maxlength=\"128\" id=\"xim_message_text_field_" + from + "\" type=\"text\" class=\"xim-input-box small-xim-input-box\"/>" +
						"<div class=\"xim-send-photo-button\" data-user-id=\"" + from + "\">&nbsp;</div></div>";
		} else {
			x_html = x_html + "<input data-user-id=\"" + from + "\" placeholder=\"just type and press enter\" maxlength=\"128\" id=\"xim_message_text_field_" + from + "\" type=\"text\" class=\"xim-input-box\"/>";
		}
					
		xhtml = x_html + "</div>";

		$("body").append(x_html);
		
		$(".xim-send-photo-button").unbind("click");
		$(".xim-send-photo-button").bind("click", function() {
		
			XKit.extensions.XIM.camera_username = $(this).attr('data-user-id');
			XKit.extensions.XIM.take_shot();	
			
		});
		
		if (dontsavewindowhistory !== true) {
			if (XKit.extensions.XIM.open_windows.indexOf(from) === -1) {
				XKit.extensions.XIM.open_windows.push(from);
				XKit.extensions.XIM.save_window_history();
			}
		}
		
		if (XKit.extensions.XIM.contacts.indexOf(from) === -1) {
			$("#xim_message_window_" + from).find(".xim-status").addClass("unknown");
			$("#xim_message_window_" + from).find(".xim-messages").before("<div class=\"xim-not-in-buddy-list\">Not in buddy list<div data-user-id=\"" + from + "\"class=\"xim-not-in-buddy-list-add\">add to my buddies</a></div>");
			$("#xim_message_window_" + from).find(".xim-messages").addClass("xim-not-in-buddy-list-added");
			
			$(".xim-not-in-buddy-list-add").click(function() {
				if (XKit.extensions.XIM.contacts.length > XKit.extensions.XIM.buddy_list_max) {
					XKit.extensions.XIM.show_error("Buddy list full","Your buddy list is full, please remove some people first.<br/>You can remove people by holding the ALT key while clicking on their username on the buddy list.");
					return;
				}
				if (XKit.extensions.XIM.contacts.indexOf(username) !== -1) {
					XKit.extensions.XIM.show_error("Already on the list","This user is already on your buddy list.");
					return;
				}
				var username = $(this).attr('data-user-id');
				XKit.extensions.XIM.contacts.push(username);
				XKit.extensions.XIM.save_contacts();
				XKit.extensions.XIM.send("XIM_CHECK " + username);
				$("#xim_message_window_" + username).find(".xim-not-in-buddy-list").remove();
				$("#xim_message_window_" + username).find(".xim-messages").removeClass("xim-not-in-buddy-list-added");
				$("#xim_message_window_" + username).find(".xim-messages").nanoScroller();
				$("#xim_message_window_" + username).find(".xim-messages").nanoScroller({ scroll: 'bottom' });
			});
		}

		if (XKit.extensions.XIM.buddy_list_status[XKit.extensions.XIM.buddy_list.indexOf(from)] === "1") {
			$("#xim_message_window_" + from).find(".xim-status").addClass("online");
		}

		for (var i=0;i<XKit.extensions.XIM.history.length;i++) {
			// alert("from: " + XKit.extensions.XIM.history[i].from + "\nto:" + XKit.extensions.XIM.history[i].to + "\n\n" + XKit.extensions.XIM.history[i].msg);
			/*if(XKit.extensions.XIM.history[i].from === from) {
				XKit.extensions.XIM.display_message_dptch(from, XKit.extensions.XIM.history[i].msg, true);	
			}*/	
			if(XKit.extensions.XIM.history[i].window === from) {
				if (XKit.extensions.XIM.history[i].from === from) {
					XKit.extensions.XIM.display_message_dptch(from, XKit.extensions.XIM.history[i].msg, true, false, true);
				} else {
					XKit.extensions.XIM.display_message_dptch(from, XKit.extensions.XIM.history[i].msg, true, true, true);
				}	
			}			
		}

		$("#xim_message_text_field_" + from).keyup(function(event){
    			if(event.keyCode == 13){
    				if ($(this).val() === "/reset_history") {
    					XKit.storage.set("XIM","message_history_" + XKit.extensions.XIM.id, "");
    					alert("Message history reset.");
    					$(this).val("");
    					return;	
    				}
				var m_to = $(this).attr('data-user-id');
        			XKit.extensions.XIM.send_msg(m_to, $(this).val());
				$(this).val("");
    			}
		});

	},

